import React from "react";
// import { Link } from "react-router-dom";
import { Card, Col, Container, Image, Row } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";

import "./UserItem.css";

const UserItem = props => {
  console.log(props.image);
  return (
    <Row lg={9}>
      <Card className="bg-pink text-white">
        <Image src={props.image} roundedCircle width="400px" height="550px" />
        <Card.Title className="title__card">{props.name}</Card.Title>
        <Container className="card_center">
          <Row>
          <Col xs={6}>
            <Card.Link href="#" className="like_dislike">
              <Image
                src={require("../../img/iconProfile/heart.png")}
                width="50px"
                height="50px"
              />
            </Card.Link>
            </Col>
            <Col xs={6}>
            <Card.Link href="#" className="like_dislike">
              <Image
                src={require("../../img/iconProfile/remove.png")}
                width="50px"
                height="50px"
              />
            </Card.Link>
          </Col>
          </Row>
        </Container>
      </Card>
    </Row>
  );
};

export default UserItem;
